import * as React from 'react';
import { Link } from "react-router-dom";

export default function App() {
  return (
    <div class="Header">

        <Link class="leftBox" href="/">
            <img class="itemLeftBox imageHeader" src=""></img>
            <span class="itemLeftBox titleHeader">
                <div class="titleHeader-top">Richard PERRET</div>
                <div class="hiding-titleHeader-bot">Richard PERRET</div>
                <div class="titleHeader-bot">Richard PERRET</div>
            </span>
        </Link>

        {/* Version Mobile */}

        {/* itemIconMenuBox */}
        <div class="iconMenuBox">
            <div class="icon-1"></div>
            <div class="icon-2"></div>
            <div class="icon-3"></div>
        </div>

        <div class="burgerMenuBox">    
            <Link class="itemBugerMenuBox" href="Project">PROJETS</Link>
            <Link class="itemBugerMenuBox" href="Contact">CONTACT</Link>
        </div>

        {/* Version Desktop */}  
        <div class="linksBox">
            <Link class="itemLinksBox blue" href="Contact">CONTACT</Link>
            <Link class="itemLinksBox" href="Project">PROJETS</Link> 
        </div>         
    </div>
  );
}
